    [],nt"revision_timestamp": "2016-07-27T22:47:44.312628",nt"name": "recreational-fishery-management-plan-for-lake-andes-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Current condition of lake Andes (1996)
    and highlights potential problems and recommendations for improving the lake as
    a hatchery. Lake Andes was a much larger body of water prior to the construction
    of an artificial outlet structure that lowered the water level by 13 feet. Since
    Lake Andes is fed almost completely by ephemeral streams; because of this the lake
    experiences fluctuating water levels and can even dry up if specific conditions
    are met. These fluctuating water levels are detrimental to most game fish, while
    less harmful to undesirable species like bullhead and carp. With a constant water
    supply and the eradication of the rough fish, the fishery in Lake Andes will continue
    to be marginal at best. Alternatives ti improve water quality include: 1) Introduce
    Northern Pike to control carp numbers; 2) Renovating the entire lake and watershed;
    3) Installing rotary screens at the control structures including the inlet of Andes
    Creek; 4) Dredging the South Unit; and/or 5) Obtain congressional approval to raise
    the lake up to the original elevation of 1450 ft above msl.",nt"license_title":
